    <title>Document</title>
    <script src="https://cdn.jsdelivr.net/npm/gsap@3.12.5/dist/gsap.min.js"></script>
    <style>
      :root {
        --width: 320px;
        --height: 250px;

        --color-dark: #091727;
        --color-coral: #ef413a;
        --color-white: #ffffff;
        --color-blue-dark: #172f4e;
        --color-blue-light: #d1edfc;
        --color-blue-dark-alt: #192f4f;

        --clip-path-left: 64px;
      }

      html,
      body {
        margin: 0;
        width: var(--width);
        height: var(--height);
        overflow: hidden;
      }

      #banner {
        width: 100%;
        height: 100%;
        position: relative;

        background-color: var(--color-dark);
        background: linear-gradient(
          90deg,
          var(--color-dark) 0%,
          var(--color-blue-dark) 150%
        );
      }

      #cta-active {
        clip-path: polygon(
          0px 0px,
          var(--clip-path-left) 0px,
          var(--clip-path-left) var(--height),
          0px var(--height)
        );

        transition: clip-path 0.35s ease-in-out;
      }

      #banner:hover {
        cursor: pointer;
        --clip-path-left: calc(64px + 148px);
      }

      #banner svg,
      #banner img {
        position: absolute;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        object-fit: cover;
      }

      #map path {
        fill: var(--color-blue-light);
        fill-opacity: 60%;
      }
    </style>
  </head>

    <script>
      document.addEventListener("DOMContentLoaded", () => {
        const styles = getComputedStyle(document.body);

        const colorBlueDarkAlt = styles.getPropertyValue(
          "--color-blue-dark-alt"
        );
        const colorBlueLight = styles.getPropertyValue("--color-blue-light");
        gsap.set(".animate", { autoAlpha: 0, y: "10%" });

        const tl = gsap.timeline({ repeat: -1, delay: 0.2, repeatDelay: 0.2 });

        let loopCount = 0;

        tl.to("#map path", {
          duration: 1,
          stagger: {
            grid: [15, 25],
            amount: 1.5,
            from: "random",
          },
          fill: colorBlueDarkAlt,
        })

          .to(
            "#text-1",
            {
              autoAlpha: 1,
              y: "0%",
            },
            ">-=1.5"
          )
          .to("#text-2", {
            autoAlpha: 1,
            y: "0%",
          })
          .to(
            ["#text-1", "#text-2"],
            {
              autoAlpha: 0,
              y: "-20%",
              duration: 0.4,
            },
            "+=3"
          )
          .to("#text-3", { autoAlpha: 1, y: "0%" })
          .to(".cta", { autoAlpha: 1, y: "0%" })
          .call(() => {
            if (loopCount >= 2) {
              tl.pause();
            }
            loopCount++;
          })
          .to(
            ["#text-3", ".cta"],
            {
              autoAlpha: 0,
              y: "-20%",
              duration: 0.4,
            },
            "+=2.2"
          )
          .to(
            "#map path",
            {
              duration: 1,
              stagger: {
                grid: [15, 25],
                amount: 0.8,
                from: "end",
                axis: "y",
              },
              fill: colorBlueLight,
            },
            "<-=0.2"
          );
      });
    </script>
